import { useEffect } from 'react'
import { observer } from '../../node_modules/mobx-react-lite/es/observer'
import '../styles/canvas.scss'

const Canvas = observer(() => {
	useEffect(() => {
		canvas.setCanvas()
	})

	return (
		<div className='canvas'>
			<canvas
				width={600}
				height={400}
			/>
		</div>
	)
})

export default Canvas
